import './App.css';
import Login from './auth/Login';
import { Route, Routes } from 'react-router';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Login />} />
      </Routes>
      <Login />      
    </div>
  );
}

export default App;
